import (
	context "context"
	fern "github.com/audiences/fern"
	fernclient "github.com/audiences/fern/client"
	foldera "github.com/audiences/fern/foldera"
	option "github.com/audiences/fern/option"
)

client := fernclient.NewClient(
	option.WithBaseURL(
		fern.Environments.EnvironmentA,
	),
)
response, err := client.FolderA.Service.GetDirectThread(
	context.TODO(),
	&foldera.GetDirectThreadRequest{
		Ids: []string{
			"ids",
		},
		Tags: []string{
			"tags",
		},
	},
)

